const data = {
  primary: {
    main: "#006bfa",
    light: "#2f6cad",
  },
  secondary: {
    main: "#f50057",
  },
  neutral: {
    main: "#007f63",
    dark: "#007168",
    light: "#4db0a8",
    lighter: "#dce8e7",
    straight: "#ffffff",
    reverse: "#000000",
    brown: "rgba(135, 91, 53, 0.1)",
  },
  background: {
    default: "#dce8e7",
    paper: "#ffffff",
  },
  action: {
    selected: "rgba(1, 1, 1, 0.2)",
    hover: "rgba(1, 1, 1, 0.08)",
  },
};

export default data;
